import "./rightSide.css";
function RightSide(props) {
  // console.log(props.firstValue)
  // console.log(props.firstDiagramNewValues)

  //gamoshveba Sums
  const gamoshvebaDzveliSum = props.gamoshveba.reduce(
    (partialSum, a) => partialSum + a,
    0
  );
  const gamoshvebAaxaliSum = props.gamoshvebaAxali.reduce(
    (partialSum, a) => partialSum + a,
    0
  );
  const gamoshvebaPerc = ((gamoshvebAaxaliSum/gamoshvebaDzveliSum)*100) - 100

  //damatebitiGirebuleba Sums
  const damatebitiDzveliSum = props.damatebiti.reduce(
    (partialSum, a) => partialSum + a,
    0
  );
  const damatebitiAxaliSum = props.damatebitiAxali.reduce(
    (partialSum, a) => partialSum + a,
    0
  );
  const damatebitiPerc = ((damatebitiAxaliSum/damatebitiDzveliSum)*100) - 100


  //dasaqmeba Sums
  const dasaqmebaSum = props.dasaqmeba.reduce(
    (partialSum, a) => partialSum + a,
    0
  );
  const dasaqmebaAxaliSum = props.dasaqmebaAxali.reduce(
    (partialSum, a) => partialSum + a,
    0
  );
  const dasaqmebaPerc = ((dasaqmebaAxaliSum/dasaqmebaSum)*100) - 100

//dasaqmeba Sums
// const dasaqmebaSum = props.dasaqmeba.reduce(
//     (partialSum, a) => partialSum + a,
//     0
//   );
//   const dasaqmebaAxaliSum = props.dasaqmebaAxali.reduce(
//     (partialSum, a) => partialSum + a,
//     0
//   );
//   const dasaqmebaPerc = ((dasaqmebaAxaliSum/dasaqmebaSum)*100) - 100

  return (
    <div className="RightInformation">
      <div className="rightHeader">
        <div className="rightHeaderChild1"></div>
        <div className="rightHeaderChild2">მთლიანი მიმდინარე ღირებულება</div>
        <div className="rightHeaderChild2">მთლიანი ახალი ღირებულება</div>
        <div className="rightHeaderChild2">ცვლილება</div>
      </div>
      <div>
        <section className="RightContent">
          <div className="RightContentChild1">გამოშვება</div>
          <div className="RightContentChild2">
            {(Math.round(gamoshvebaDzveliSum * 10) / 10).toString()}
          </div>
          <div className="RightContentChild2">{(Math.round(gamoshvebAaxaliSum * 10) / 10).toString()}</div>
          <div className="RightContentChild2">{Math.round(gamoshvebaPerc*10)/10}</div>
        </section>
        <section className="RightContent">
          <div className="RightContentChild1">დამატებული ღირებულება</div>
          <div className="RightContentChild2">{(Math.round(damatebitiDzveliSum * 10) / 10).toString()}</div>
          <div className="RightContentChild2">{(Math.round(damatebitiAxaliSum * 10) / 10).toString()}</div>
          <div className="RightContentChild2">{Math.round(damatebitiPerc*10)/10}</div>
        </section>
        <section className="RightContent">
          <div className="RightContentChild1">დასაქმება</div>
          <div className="RightContentChild2">{(Math.round(dasaqmebaSum * 10) / 10).toString()}</div>
          <div className="RightContentChild2">{(Math.round(dasaqmebaAxaliSum * 10) / 10).toString()}</div>
          <div className="RightContentChild2">{Math.round(dasaqmebaPerc*10)/10}</div>
        </section>
        <section className="RightContent">
          <div className="RightContentChild1">იმპორტი</div>
          <div className="RightContentChild2">1</div>
          <div className="RightContentChild2">1</div>
          <div className="RightContentChild2">1</div>
        </section>
        <section className="RightContent">
          <div className="RightContentChild1">
            ძირითადი კაპიტალის მთლიანი ფორმირება
          </div>
          <div className="RightContentChild2">1</div>
          <div className="RightContentChild2">1</div>
          <div className="RightContentChild2">1</div>
        </section>
        <section className="RightContent">
          <div className="RightContentChild1">შრომის ანაზღაურება</div>
          <div className="RightContentChild2">1</div>
          <div className="RightContentChild2">1</div>
          <div className="RightContentChild2">1</div>
        </section>
      </div>
    </div>
  );
}

export default RightSide;
